import React from "react";

export default class ModuleListComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      module: {
        id: -1,
        titile: ""
      }
    };
  }

  render() {
    return (
        <div>

            <ul className="list-group">
            {
                courses.map(course =>
                    <ModuleItem key ={course.id} course={course}/>
                 )
            }
            </ul>
        </div>
    )
  }
}
